import React from 'react';

function UserInput({ setInputValues }) {
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setInputValues(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  return (
    <div className="UserInput">
      <h2>User Input</h2>
      <input type="number" name="input1" onChange={handleInputChange} />
      <input type="number" name="input2" onChange={handleInputChange} />
      <input type="number" name="input3" onChange={handleInputChange} />
      <input type="number" name="input4" onChange={handleInputChange} />
    </div>
  );
}

export default UserInput;
